const DataContext = createContext();

export const DataProvider = ({ children }) => {
  let [doorBell] = 
  useState([
    {
      name: "DoorBell1",
      price: 349.99,
      image: "images/doorBells/db1.jpg",
      maker: "amazon",
      type: "doorBells",
    },
    {
      name: "DoorBell2",
      price: 399.99,
      image: "images/doorBells/db2.jpg",
      maker: "amazon",
      type: "doorBells",
    },
    {
      name: "DoorBell3",
      price: 439.99,
      image: "images/doorBells/db3.jpg",
      maker: "arlo",
