      maker: "arlo",
      type: "doorBells",
    },
    {
      name: "DoorBell5",
      price: 341.99,
      image: "images/doorBells/db5.jpg",
      maker: "nestHello",
      type: "doorBells",
    },
  ]);




  return (
    <DataContext.Provider value={{ doorBell }}>{children}</DataContext.Provider>
  );
};

export const useData = () => {
  return useContext(DataContext);
};
